import './Involved.scss'
import React, { useEffect, useState } from 'react';

function Involved() {
    function onLoad() {
        var ps = new window.ParticleSlider({
            ptlGap: 0,
            mouseForce: 1000,
            monochrome: true,
            color: '#346e8a',
            ptlSize: 1,
        });
        var ptl = new ps.Particle(ps);
        ptl.ttl = 10;
    }

    const [program, setProgram] = useState('code')

    useEffect(onLoad, [])


    return (
        <div id="Involved">
            <div className='get-involved-block'>
                {/* <h1>Replace with get involved image</h1> */}
                <div id="particle-slider">
                    <div class="slides">
                        <div class="slide"
                            data-src="data:image/png;base64,">
                        </div>
                    </div>
                    <canvas class="draw" height="500" width="300"></canvas>
                </div>
            </div>
            <div className='container mt-80'>
                <div className='row'>
                    <div className='col-3 involved-row'>
                        Partner with us
                    </div>
                    <div className='col-3 involved-row'>
                        Bring a course to your school
                        <div className='line'></div>
                    </div>
                    <div className='col-3 involved-row'>
                        Teacher or mentor
                    </div>
                    <div className='col-3 involved-row'>
                        volunteer
                    </div>
                </div>

                <div className='details mt-60'>
                    <h2>
                    Please fill out the form below if you are interested in learnign more about our programs and how to get involved!
                    </h2>
                </div>

                <form className='mt-80 mb-80'>
                    <div className='row'>
                        <div className='col-md-6'>
                            <div className='mb-7 fs-16'>First Name:</div>
                            <div>
                                <input placeholder='First Name' className='form-control' />
                            </div>
                        </div>
                        <div className='col-md-6'>
                            <div className='mb-7 fs-16'>Last Name:</div>
                            <div>
                                <input placeholder='Last Name' className='form-control' />
                            </div>
                        </div>
                    </div>

                    <div className='row mt-20'>
                        <div className='col-md-6'>
                            <div className='mb-7 fs-16'>Email:</div>
                            <div>
                                <input placeholder='John@gmail.com' className='form-control' />
                            </div>
                        </div>
                        <div className='col-md-6'>
                            <div className='mb-7 fs-16'>How would you like to partner with us:</div>
                            <div>
                                <input placeholder='Partner with Us' className='form-control' />
                            </div>
                        </div>
                    </div>

                    <div className='row mt-20'>
                        <div className='col-md-6'>
                            <div className='mb-7 fs-16'>
                                Which programs(s) are you interested in?:
                            </div>
                            <div className='buttons'>
                                <div onClick={()=>setProgram('code')} className={`normal ${program == 'code' && 'gold'}`}>CodeConnects</div>
                                <div onClick={()=>setProgram('qubit')} className={`normal ${program == 'qubit' && 'gold'}`}>Qubit by Qubit</div>
                                <div onClick={()=>setProgram('train')} className={`normal ${program == 'train' && 'gold'}`}>TRAIN</div>
                            </div>
                        </div>
                    </div>

                    <div className='row mt-20'>
                        <div className='col-md-6'>
                            <div className='mb-7 fs-16'>Company/Organization:</div>
                            <div>
                                <input placeholder='ABC co.' className='form-control' />
                            </div>
                        </div>
                        <div className='col-md-6'>
                            <div className='mb-7 fs-16'>How did you hear about The Coding School:</div>
                            <div>
                                <input placeholder='Type Answer' className='form-control' />
                            </div>
                        </div>
                    </div>

                    <div className='row mt-5'>
                        <div className='col-md-6'>
                            <div className='row'>

                                <div className='col-md-12 mt-15'>
                                    <div className='mb-7 fs-16'>Title:</div>
                                    <div>
                                        <input placeholder='CFO' className='form-control' />
                                    </div>
                                </div>
                                <div className='col-md-12 mt-15'>
                                    <div className='mb-7 fs-16'>Phone:</div>
                                    <div>
                                        <input placeholder='111-111-1111' className='form-control' />
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div className='col-md-6 mt-15'>
                            <div className='mb-7 fs-16'>Any questions/comments?</div>
                            <div>
                                <textarea placeholder='Type Here' rows={5} className='form-control' />
                            </div>
                        </div>
                    </div>
                    <div className='row mt-50'>
                        <div className='submitButton'>
                            SUBMIT
                        </div>
                    </div>
                </form>
            </div>
        </div>
    )
}

export default Involved;
